import React from 'react';
import './card.css';

function Card(props) {
  return (
    <div
      className='card'
      style={{
        width: props.width,
        hight: props.hight,
        margin: props.margin,
        background: props.background ? props.background : '#fff',
      }}
    >
      {props.children}
    </div>
  );
}

export default Card;
